query servicePrincipalAdmin ( $accountId:ID! $adminID:ID! ) {
	servicePrincipalAdmin ( accountId:$accountId adminID:$adminID ) {
		id 
		name 
		email 
		creationDate 
		adminType 
		managedRoles  {
			roleAdminRole: role {
				id 
				name 
				description 
				isPredefined 
			}
			allowedEntitiesAdminRole: allowedEntities {
				id 
				name 
				type 
			}
			allowedAccounts
		}

		resellerRoles  {
			roleAdminRole: role {
				id 
				name 
				description 
				isPredefined 
			}
			allowedEntitiesAdminRole: allowedEntities {
				id 
				name 
				type 
			}
			allowedAccounts
		}

	}	
}
